  fullName: SuperOffice.CRM.ArchiveLists.Aggregation.PercentOfTotalAggregation.Clone()
  type: Method
  source:
    path: SoDataBase
    isExternal: true
  assemblies:
  - SoDataBase
  namespace: SuperOffice.CRM.ArchiveLists.Aggregation
  summary: "\nClone: Called when creating <strong>detail level</strong> instances; takes snapshot of last item\nseen by outer level and saves as the sum to be used in calculations\n"
  remarks: "\nSummary levels accumulate data into <xref href=\"SuperOffice.CRM.ArchiveLists.Aggregation.PercentOfTotalAggregation._theSum\" data-throw-if-not-resolved=\"false\"></xref> and that is what should be used as their \nvalue; while detail levels receive the <xref href=\"SuperOffice.CRM.ArchiveLists.Aggregation.PercentOfTotalAggregation._lastItem\" data-throw-if-not-resolved=\"false\"></xref>, which is what <strong>they</strong> should\nuse as their value. The lastItem -> sum assignment in this method is where the asymmetry between\nnested summary levels and the detail level is expressed.\n"
  syntax:
    content: public IAggregationTwoPassPlugin Clone()
    return:
      type: SuperOffice.CRM.ArchiveLists.Aggregation.IAggregationTwoPassPlugin
    content.vb: Public Function Clone As IAggregationTwoPassPlugin
